import axios from "axios";

//Sending Password and Username:
const sendPasswordAndUsername = async (username, password) =>
{
    const response = await axios.post('http://localhost:9000')//,{username:username,password:password})
    return response
    return username



}


export {sendPasswordAndUsername}
